.
Germanium adalah unsur kimia dengan simbol Ge dan nomor atom 32. Ia adalah metaloid berkilau, keras-rapuh, putih keabu-abuan dalam gugus karbon, secara kimiawi mirip dengan tetangganya silikon dan timah. Germanium murni adalah semikonduktor dengan tampilan yang mirip dengan silikon unsur. Seperti silikon, germanium secara alami bereaksi dan membentuk kompleks dengan oksigen di alam.
.
Karena jarang muncul dalam konsentrasi tinggi, germanium ditemukan relatif terlambat dalam sejarah kimia. Germanium menempati peringkat hampir lima puluh dalam kelimpahan relatif elemen di kerak bumi. Pada tahun 1869, Dmitri Mendeleev meramalkan keberadaannya dan beberapa propertinya dari posisinya pada tabel periodiknya, dan dinamakan unsur ekasilicon. Hampir dua dekade kemudian, pada tahun 1886, Clemens Winkler menemukan unsur baru bersama dengan perak dan belerang, dalam mineral langka yang disebut argyrodite. Meskipun unsur baru agak mirip arsen dan antimon dalam penampilan, rasio penggabungan dalam senyawa setuju dengan prediksi Mendeleev untuk kerabat silikon. Winkler menamai elemen tersebut setelah negaranya, Jerman. Saat ini, germanium ditambang terutama dari sfalerit (bijih utama seng), meskipun germanium juga diperoleh secara komersial dari bijih perak, timah, dan tembaga.
.
Elemental germanium digunakan sebagai semikonduktor dalam transistor dan berbagai perangkat elektronik lainnya. Secara historis, dekade pertama elektronik semikonduktor sepenuhnya didasarkan pada germanium. Saat ini, penggunaan akhir utama adalah sistem serat optik, optik inframerah, aplikasi sel surya, dan dioda pemancar cahaya (LED).
